(1, 'Motos i complements.', 'Golden Bike''s', 41.6794590000, 2.2851240000, 'http://layar.gplavui.com/lagarriga/45.jpg', '', 'Direcció:  anselm clavé, 61', 'Esports - Bicicletes', 2, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 32),
(3, 'Tot per l''esport.', 'Mon Sport', 41.6847310000, 2.2864650000, 'http://layar.gplavui.com/lagarriga/50.jpg', 'Horari: De dilluns a dissabte de 9.30 a 13.30h i de 17 a 20.30h.', 'Direcció: samalus, 4B', 'Esports i Moda', 2, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 32),
(2, 'Des de l''any 1983 treballem amb primeres marques del món de l''esport com NIKE, ADIDAS, SPEEDO,CONVERSE, AIGLE, FERRARI i d''altres. Tenim productes tan', 'L''Esport', 41.6791940000, 2.2851560000, 'http://layar.gplavui.com/lagarriga/104.jpg', 'Horari: De dilluns a dissabte de 9.30 a 13.30h i de 17 a 20.30h', 'Direcció:  Centre, 2 i plaça Can Dachs 10', 'Esports i Moda', 2, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 32),
(4, 'Finques La Garriga és una empresa dedicada a la construcció i venda de productes immobiliaris amb seu a la Garriga. Va néixer ara ja fa més de 35 anys', 'Finques La Garriga', 41.6828500000, 2.2860850000, 'http://layar.gplavui.com/lagarriga/78.jpg', '', 'Direcció: Banys, 45', 'Agència Inmobiliaria', 2, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 1),
(14, 'Des de la seva obertura en 1840, el Balneari Blancafort es va convertir en un lloc de prestigi on es trobaven personalitats de la vida social barcelon', 'Balneari Blancafort', 41.6816460000, 2.2870660000, 'http://layar.gplavui.com/lagarriga/55.jpg', '', 'Direcció:  Banys 59', 'Oci i Cultura - Balnearis', 2, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 256),
(5, 'Entra a la nostra web. Hi trobarà les millors ofertes inmobiliaries i un servei personalitzat de qualitat amb experiència contrastada amb el sector.', 'Jaume Travé Gestió de Finques', 41.6794190000, 2.2867440000, 'http://layar.gplavui.com/lagarriga/79.jpg', 'Direcció:  Banys, 132 local A', 'Horari: De dilluns a divendres de 9.30 a 13.30h i de 16 a 20h. Dissabtes visites concertades al 670 831 713.', 'Agència Inmobiliaria', 2, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 1),
(16, 'Instal·lacions Públiques\r\nPolicia Local', 'Policia Local', 41.6853120000, 2.2859140000, 'http://layar.gplavui.com/lagarriga/LG.jpg', '', 'Adreça: Centre, 6', 'Policia Local', 1, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 4096),
(15, 'Instal·lacions Públiques\r\nAjuntament - Informació i Administració', 'Ajuntament', 41.6853120000, 2.2859140000, 'http://layar.gplavui.com/lagarriga/LG.jpg', 'Horari: de dilluns a divendres de 9h a 14h dilluns i dijous de 16,30h a 19h', 'Pl. de l''Església, 2', 'Ajuntament - Informació i Administració', 1, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 4096),
(17, 'Instal·lacions Públiques\r\nServeis socials', 'Serveis socials', 41.6854600000, 2.2859720000, 'http://layar.gplavui.com/lagarriga/LG.jpg', 'Horari d''Atenció al públic: Dilluns, dimecres i divendres de 10 a 14h. Dijous de 16.30 a 19h', 'Adreça: Samalús, 2', 'Serveis socials', 1, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 4096),
(18, 'Instal·lacions Públiques\r\nCan Raspall', 'Can Raspall', 41.6828320000, 2.2892760000, 'http://layar.gplavui.com/lagarriga/LG.jpg', '', ' Adreça: Banys, 38-40', 'Can Raspall', 1, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 4096),
(19, 'Atenció: HORARI D''HIVERN: Matins: Dijous i dissabte de 9.30 a 13.30h Tardes: De dilluns a divendres de 16 a 20.30h', 'Instal·lacions Públiques Culturals', 41.6832010000, 2.2859930000, 'http://layar.gplavui.com/lagarriga/LG.jpg', 'HORARI D''ESTIU: del 15 de juny al 10 de setembre Matins: Dijous i divendres de 9.30 a 13.30h Tardes: De dilluns a divendres de 16 a 20.30h', 'Adreça: Centre, 49', 'Instal·lacions Públiques Culturals - Biblioteca Municipal Núria Albó', 1, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 4096),
(20, 'Programació estable de teatre, música i dansa.\r\nAforament: 384 butaques.\r\nVenda anticipada a qualsevol oficina de la Caixa de Catalunya i a través del', 'Teatre de la Garriga el Patronat', 41.6856690000, 2.2854780000, 'http://layar.gplavui.com/lagarriga/LG.jpg', '', ' Adreça: Passeig, 42', 'Instal·lacions Públiques Culturals - Teatre de la Garriga el Patronat', 1, 1, NULL, NULL, 0.0000000000, 0, 0, 1, 1, 4096);
