(41, 'PhD', 'option=com_phd', 0, 0, '', 'PhD', 'com_phd', 0, 'js/ThemeOffice/component.png', 0, 'phdConfig_AdminName=Roberto Bartolome\nphdConfig_AdminEmail=roberto.bartolome@irbbarcelona.org\nphdConfig_LiveSite=http://localhost/postdoc\nphdConfig_ClosingDateTime=2011-12-21 23:59:00\nphdConfig_LimitAge=99\nphdConfig_DocsPath=/docs_phd\nphdConfig_MaxNumberOfFiles=5\nphdConfig_SendBCC=0\nphdConfig_Application=2\nphdConfig_FirstChoice=1\nphdConfig_InvalidEmailProviders=gmail, yahoo, bing\nphdConfig_EmailRefereeSubject=subject de email a referee\nphdConfig_EmailRefereeBody=<html>\\n\\n<head>\\n\\n<meta http-equiv="Content-Type" content="text/html; charset=iso-8859-1">\\n\\n<title>email</title>\\n\\n</head>\\n\\n\\n\\n<body>\\n\\n<p>Dear #referee#,</p>\\n\\n<p>My name is #name#, and you can upload the file in the following link:</p>\\n\\n<p>#link#</p>\\n\\n<p>Thanks,</p>\\n\\n<p>#name#</p>\\n\\n</body>\\n\\n</html>\\n\nphdConfig_EmailApplicantSubject1=News from IRB Barcelona PhD programme\nphdConfig_EmailApplicantBody1=Dear #name#,\\nThis email is to inform you that IRB Barcelona has not yet received one of the two letters of recommendation requested for application to IRB Barcelona PhD fellowships. We remind you that these letters must be sent directly to us by your referees (either by e-mail to phd@irbbarcelona.org, by airmail or by fax to our contact address) and that the deadline for receipt is 25 January 2009.\\nBest regards,\\nIRB Barcelona PhD Programme\\nThis is an automatically generated message. Please do not answer.\nphdConfig_EmailApplicantSubject2=News from IRB Barcelona PhD programme\nphdConfig_EmailApplicantBody2=Dear #name#,\\nThank you for your interest in IRB Barcelona and for submitting your application for a PhD position at our institute.\\nThis e-mail is to confirm that your application has been submitted correctly. You will hear back from us once the call closes and the first part of the evaluation process has been completed, around February 2009.\\nBest regards,\\nIRB Barcelona PhD Programme\\nThis is an automatically generated message. Please do not answer.\nphdConfig_EmailApplicantSubject3=News from IRB Barcelona PhD programme\nphdConfig_EmailApplicantBody3=Dear #name#,\\nThank you, once again, for applying for a Ph.D. grant at IRB Barcelona. The call closed the 25 January 2009 and the first part of the selection process has now been completed.\\nAfter careful evaluation of your considerable merits, I am sorry to inform you that on this occasion you have not been short-listed.\\nI thank you once again for your interest in IRB Barcelona and wish you every success in the future.\\nBest regards,\\nIRB Barcelona PhD Programme\\nThis is an automatically generated message. Please do not answer.\nphdConfig_EmailApplicantSubject4=News from IRB Barcelona PhD programme\nphdConfig_EmailApplicantBody4=Dear #name#,\\nThank you once again for your recent application for a PhD grant at IRB Barcelona. After careful evaluation of your merits, I am pleased to inform you that you have been short-listed as a potential candidate for one of the grants currently on offer. You will soon receive an official letter with the invitation to visit our Institute on 30 and 31 of March 2009 for interviews.\\nBest regards,\\nIRB Barcelona PhD Programme\\nThis is an automatically generated message. Please do not answer.\nphdConfig_EmailApplicantSubject5=News from IRB Barcelona PhD programme\nphdConfig_EmailApplicantBody5=Dear #name#,\\nAfter completion of the selection process for PhD fellowships offered by the Institute for Research in Biomedicine (IRB Barcelona), I regret to inform you than on this occasion your application has not been successful. Given the considerable competition for these fellowships and exceptionally high number and quality of applicants, I congratulate you on being short-listed.\\nI thank you once again for your interest in  IRB Barcelona and wish you every success in the future.\\nYours sincerely,\\nIRB Barcelona PhD Programme\\nThis is an automatically generated message. Please do not answer.\nphdConfig_EmailApplicantSubject6=News from IRB Barcelona PhD programme\nphdConfig_EmailApplicantBody6=Dear #name#,\\nAfter completion of the selection process, it is our pleasure to offer you a PhD fellowship at IRB Barcelona. We congratulate you on this achievement. As you know there was considerable competition for these fellowships and the number and quality of applicants were exceptionally high.\\nWe will officially contact you in the near future with more details of our offer.\\nBest regards,\\nIRB Barcelona PhD Programme\\nThis is an automatically generated message. Please do not answer.\nphdConfig_EmailApplicantSubject7=News from IRB Barcelona PhD programme\nphdConfig_EmailApplicantBody7=Dear #name#,\\nThank you for your interest in IRB Barcelona and for submitting your application for a PhD position at our institute.\\nWe regret to inform you that we have received no recommendations letters. You have therefore been excluded from the selection process.\\nBest regards,\\nIRB Barcelona PhD Programme\\nThis is an automatically generated message. Please do not answer.\n\n', 1),
